import Carousel from "react-bootstrap/Carousel";


const CarouselItemBrand = () => {
    return (
        <Carousel>
            <Carousel.Item>
            <img
                className="d-block w-100"
                src="images/straight.03addefa.jpg"
                alt="First slide"
            />
            <Carousel.Caption>
                <h3>First slide label</h3>
                <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
            </Carousel.Caption>
            </Carousel.Item>
        </Carousel>
    );
};


export default CarouselItemBrand;
